/* header */
.header-top .top-links > li.menu-item > a { text-transform: none; }
#header .share-links a { width: 26px; height: 26px; margin: 0; border-radius: 13px; }
#header .share-links a:not(:hover) { background: none; color: inherit; }
#header .header-top .welcome-msg { text-transform: uppercase; }
#header .header-top .top-links { border-left: 1px solid #e7e7e7; border-right: 1px solid #e7e7e7; margin-right: .5rem; padding: 0 .25rem; }
#header .top-links>li.menu-item>a, .top-links li { line-height: 1.8; }
#header .porto-sicon-box .porto-icon { margin-right: 3px; }
#main-menu.centered .main-menu > li.menu-item, .main-menu-wrap .main-menu .menu-custom-block a:not(:last-child) { margin-right: 35px; }
.main-menu-wrap { border-top: 2px solid #e7e7e7;  }
.mega-menu.menu-hover-line>li.menu-item>a:before { height: 2px; top: -2px; }
#header .header-contact { display: -ms-inline-flexbox; display: inline-flex; -ms-flex-align: center; align-items: center; margin: 0; padding: 0; border-right: none; }
#header .porto-sicon-box { margin-bottom: 0; }
#header .porto-sicon-box .porto-sicon-img { margin-right: 8px; }
#header .wishlist i, #header .my-account i { font-size: 27px; display: block; }
#mini-cart { font-size: 32px !important; }
#mini-cart .minicart-icon { width: 25px; height: 20px; border: 2px solid #222529; border-radius: 0 0 5px 5px; position: relative; opacity: .9; margin: 6px 3px 0; }
#mini-cart .minicart-icon:before { content: ''; position: absolute; border: 2px solid; border-color: inherit; border-bottom: none; border-radius: 10px 10px 0 0; left: 50%; top: -8px; margin-left: -7.5px; width: 15px; height: 11px; }
.sticky-header a { color: #222529; }

/* pages */
.btn-modern { font-weight: 700; }
.btn-modern.btn-lg { font-size: 0.9375rem; padding: 1.1em 3em; }
.coupon-sale-text { transform: rotate(-2deg); letter-spacing: -0.02em; font-weight: 700; display: inline-block; padding: 4px 8px; position: relative; }
.coupon-sale-text sub { position: absolute; left: 100%; margin-left: .25rem; font-size: .625em; line-height: 1; bottom: .25em; }
.coupon-sale-text b { color: #fff; }
.coupon-sale-text i { font-style: normal; position: absolute; left: -2.25em; top: 50%; transform: translateY(-50%) rotate(-90deg); font-size: .4em; opacity: .6; letter-spacing: 0; }

/* shop */
.products-list .product-inner { display: -ms-flexbox; display: flex; -ms-flex-align: center; align-items: center; }
.products-list .list li.product .product-image { flex: 0 0 50%; max-width: 50%; margin: 0; padding-right: 15px; }
.products-list .list li.product .product-content { flex: 0 0 50%; max-width: 50%; }
.products-list .add-links-wrap, .products-list li.product .description, .products-list .product-image .labels { display: none !important; }
.products-list .list li.product h3 { font-size: .9375rem; font-weight: 400; }

/* home */
.tabs.tabs-simple .featured-boxes { border-bottom: 2px solid #eee; font-family: Poppins; font-weight: 700; margin-bottom: 30px; }
.tabs.tabs-simple .featured-boxes { -webkit-justify-content: flex-start; -moz-justify-content: flex-start; -ms-flex-pack: start; justify-content: flex-start; }
.tabs.tabs-simple .featured-boxes > li { margin-bottom: -2px; padding-left: 0; padding-right: 30px; }
.tabs.tabs-simple .featured-boxes > li:last-child { padding-right: 0 }
.tabs.tabs-simple .featured-boxes > li .nav-link { padding: 10px 0 !important; border-bottom-width: 2px !important; font-size: .875rem !important; }
.tabs.tabs-simple .nav-tabs > li .nav-link,
.tabs.tabs-simple .nav-tabs > li .nav-link:hover,
.tabs.tabs-simple .nav-tabs > li .nav-link:focus { color: #282d3b; }
.tabs.tabs-simple .nav-tabs > li .nav-link:hover,
.tabs.tabs-simple .nav-tabs > li .nav-link:focus,
.tabs.tabs-simple .nav-tabs > li.active .nav-link:hover,
.tabs.tabs-simple .nav-tabs > li.active .nav-link:focus,
.tabs.tabs-simple .nav-tabs > li.active .nav-link { color: #7aa93c; }
.widget .widgettitle { font-size: 1.23em; color: #2b2b2d; }

/* sidebar */
.no-breadcrumbs .main-content, body.woocommerce .main-content,
.no-breadcrumbs .left-sidebar, body.woocommerce .left-sidebar,
.no-breadcrumbs .right-sidebar, body.woocommerce .right-sidebar { padding-top: 0; }

/* footer */
#footer .widget_wysija_cont .wysija-submit { height: 48px; padding-left: 25px; padding-right: 25px; text-transform: uppercase; font-weight: 700; border-radius: 0 30px 30px 0; }
#footer .widget_wysija_cont .wysija-input { height: 48px; padding-left: 25px; padding-right: 25px; background: #292c30; border-radius: 30px 0 0 30px; }
#footer .widgettitle, #footer .widget-title { font-size: 15px; font-weight: 700; }
#footer .footer-main > .container:after { content: ''; display: block; position: absolute; left: 10px; bottom: 0; width: calc(100% - 20px); border-bottom: 1px solid #313438; }
#footer .share-links a { box-shadow: none; font-size: 12px; width: 37px; height: 37px; border: 1px solid rgb(255, 255, 255, .06); }
#footer .widget { margin-bottom: 15px; margin-top: 0; }
#footer .widget.contact-info i { display: none; }
#footer .contact-details strong, #footer .contact-details span { padding-left: 0; }
#footer .contact-details strong { line-height: 1em; }

/* newsletter */
.newsletter-popup-form { position: relative; max-width: 740px; }

